tables.table_schema:
CREATE TABLE HousingSolutions (
    solution_id INT PRIMARY KEY,
    strategy VARCHAR(255),
    timeline VARCHAR(100),
    budget DECIMAL
);

CREATE TABLE AffordableHousingStrategies (
    strategy_id INT PRIMARY KEY,
    strategy_name VARCHAR(100) NOT NULL,
    description TEXT NOT NULL
);

CREATE TABLE HouseholdIncome (
    income_id INT PRIMARY KEY,
    housing_id INT,
    income_amount DECIMAL(10, 2)
);

CREATE TABLE HousingExpenses (
    expense_id INT PRIMARY KEY,
    housing_id INT,
    expense_type VARCHAR(50),
    expense_amount DECIMAL(10, 2)
);

CREATE TABLE HousingAssistance (
    assistance_id INT PRIMARY KEY,
    housing_id INT,
    assistance_type VARCHAR(50),
    provider VARCHAR(100)
);
